import './App.css';
import Navbar from './components/Navbar.js';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import { MdDashboard } from 'react-icons/md';


function App() {
  return (
    <div>
     <Router>
       <div className='title'>
       <MdDashboard/>
        <h2 >Product Management Software</h2>
       </div>

        <Navbar>

        </Navbar>

        <Switch>
          <Route path='/'/>
        </Switch>
     </Router>

    </div>

  );
}

export default App;
